import React from 'react';
import '../CSS/Hero.css'; // Ensure your CSS is imported

const Hero = () => {
    return (
        <div className="Hero">
            <div className="hero-content">
                <h1 className="hero-heading">Welcome to Foodie's Paradise</h1>
                <p className="hero-paragraph">Experience a culinary journey like no other! Indulge in our delicious dishes made with fresh ingredients and love.</p>
                <button className="cta-button">Explore Our Menu</button>
            </div>
        </div>
    );
};

export default Hero;
